import forest from './images/forest.jpg';
import hare from './images/hare.jpg';
import dinning from './images/dinning-and-kitchen.jpg';
import Contact from "./Contact";
import vase from './images/superb-vase.jpg';

export default function App() {
  return (
    <div>
      <Contact image={ forest }/>
      <Contact image={ hare }/>
      <Contact image={ dinning }/>
      <Contact image={ vase }/>
    </div>
  );
};
